import React from 'react';
import styled from 'styled-components';
import './YourPerspective.css';
import TitleH2 from './TitleH2.js';
import SubTitle from './SubTitle.js';
import GreenDots from '../img/greendots.svg'


const Container = styled.div`
    width: 1887px;
    height: 1066px;
    margin: 0 0 80px;
    position: relative;
    text-align: center;


`

const Box = styled.div`
    width: 1140px;
    height: 793px;
    text-align: center;
    padding: 50px 10px 35px;
    margin: 50px 344px 0;
    position:absolute;
    top: -700px;
    background: #ffffff;

`
const Image = styled.div`
    text-align: left;
    margin-left: 36px;
`
const Paragraf = styled.p`
    font-size: 24px;
    line-height: 1.5em;
    font-family: 'Nunito Sans', sans-serif;
    font-weight: 700px;


`;

class WhyItWorks extends React.Component{
    render(){
        return(
            <Container>
                <Box>
                    <Image><img src={GreenDots} alt=""/></Image>
                    <TitleH2 text="Why it Works"/>
                    <Paragraf>After 7 years and 45 million learners, 
                    <br/>we know what will help you succeed.
                    </Paragraf>
                </Box>
            </Container>
        );
    }

}

export default WhyItWorks;
